import { Component } from '@angular/core';
import { SpeakerService, RegisterSpeakerRequest } from '../speaker.service';

@Component({
  selector: 'app-register-speaker',
  templateUrl: './register-speaker.component.html',
  styleUrls: ['./register-speaker.component.css']
})
export class RegisterSpeakerComponent {
  speaker: RegisterSpeakerRequest = {
    username: '',
    password: '',
    name: '',
    email: '',
    phone: '',
    address: '',
    keySkills: []
  };

  successMessage = '';
  errorMessage = '';

  constructor(private speakerService: SpeakerService) {}

  register() {
    this.successMessage = '';
    this.errorMessage = '';

    this.speakerService.registerSpeaker(this.speaker).subscribe({
      next: (res) => {
        this.successMessage = '✅ Speaker registered successfully!';
        this.speaker = { username: '', password: '', name: '', email: '', phone: '', address: '', keySkills: [] };
      },
      error: (err) => {
        this.errorMessage = err.error?.message || '❌ Registration failed';
      }
    });
  }
}
<div class="form-container">
  <h2>Register Speaker</h2>

  <form (ngSubmit)="register()">
    <input [(ngModel)]="speaker.username" name="username" placeholder="Username" required />
    <input [(ngModel)]="speaker.password" name="password" type="password" placeholder="Password" required />
    <input [(ngModel)]="speaker.name" name="name" placeholder="Full Name" required />
    <input [(ngModel)]="speaker.email" name="email" type="email" placeholder="Email" required />
    <input [(ngModel)]="speaker.phone" name="phone" placeholder="Phone" required />
    <input [(ngModel)]="speaker.address" name="address" placeholder="Address" required />
    <input [(ngModel)]="speaker.keySkills" name="keySkills" placeholder="Key Skills (comma separated)" />

    <button type="submit">Register</button>
  </form>

  <p class="success" *ngIf="successMessage">{{ successMessage }}</p>
  <p class="error" *ngIf="errorMessage">{{ errorMessage }}</p>
</div>
